import React from 'react';
import { Container, Header, Menu } from 'semantic-ui-react';

const ResultPage = () => {
    const [visualQState, setVisualQState] = React.useState('coop')
    const [visualLState, setVisualLState] = React.useState('coop')

    const handleQClick = (event, {name}) => {
        setVisualQState(name)
    }

    const handleLClick = (event, {name}) => {
        setVisualLState(name)
    }

    return <Container>
        <Header as='h2'>Results of LSTM Training</Header>
        <Menu fluid pointing secondary position='center' widths={6}>
            <Menu.Item
                name='coop'
                active={visualLState === 'coop'}
                onClick={handleLClick}
            />
            <Menu.Item
                name='defect'
                active={visualLState === 'defect'}
                onClick={handleLClick}
            />
            <Menu.Item
                name='copy'
                active={visualLState === 'copy'}
                onClick={handleLClick}
            />
            <Menu.Item
                name='grudge'
                active={visualLState === 'grudge'}
                onClick={handleLClick}
            />
        </Menu>
        <Header as='h2'>Results of Q-Table Training</Header>
        <Menu fluid pointing secondary position='center' widths={6}>
            <Menu.Item
                name='coop'
                active={visualQState === 'coop'}
                onClick={handleQClick}
            />
            <Menu.Item
                name='defect'
                active={visualQState === 'defect'}
                onClick={handleQClick}
            />
            <Menu.Item
                name='copy'
                active={visualQState === 'copy'}
                onClick={handleQClick}
            />
            <Menu.Item
                name='grudge'
                active={visualQState === 'grudge'}
                onClick={handleQClick}
            />
        </Menu>     
    </Container>
}

export default ResultPage;
